import styled from "styled-components";

const StyledHeader = styled.div`
  width: 100%;
  height: 45px;

  background: rgb(66, 255, 0, 0.6);
`;

const Header = () => {
  return (
    <StyledHeader>
      <p style={{ fontSize: "16px", fontWeight: 700, letterSpacing: "5px" }}>
        ACTIVE GAMES (4)
      </p>
    </StyledHeader>
  );
};

export default Header;
